const Preset = ( { preset, setPreset }) => {

  return (
    <div>
      <button onClick={setPreset} style={{backgroundColor: `${preset.selected ? 'gray' : 'white'}`}}>{preset.name}</button>
    </div>
  )
}

export default Preset
